// In Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar">
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/district">District Court</Link></li>
        <li><Link to="/high">High Court</Link></li>
        <li><Link to="/supreme">Supreme Court</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
